def _to_escaped_json(obj: TypeJsonValue) -> str:
    def escape_html_chars(text):
        escape_dict = {'<': '\\u003c', '>': '\\u003e', '&': '\\u0026', "'": '\\u0027'}
        return "".join(escape_dict.get(c, c) for c in text)

    def custom_json_encoder(obj):
        if isinstance(obj, str):
            return escape_html_chars(obj)
        return obj

    return json.dumps(obj, default=custom_json_encoder)

