import numpy as np
import pandas as pd
import pytest
from jinja2 import Template
import folium
from folium.plugins import FastMarkerCluster
from folium.utilities import normalize
def test_fast_marker_cluster():
    n = 100
    np.random.seed(seed=26082009)
    data = np.array([np.random.uniform(low=35, high=60, size=n), np.random.
        uniform(low=-12, high=30, size=n)]).T
    m = folium.Map([45.0, 3.0], zoom_start=4)
    mc = FastMarkerCluster(data).add_to(m)
    out = normalize(m._parent.render())
    assert '<script src="https://cdnjs.cloudflare.com/ajax/libs/leaflet.markercluster/1.1.0/leaflet.markercluster.js"></script>' in out
    assert '<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/leaflet.markercluster/1.1.0/MarkerCluster.css"/>' in out
    assert '<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/leaflet.markercluster/1.1.0/MarkerCluster.Default.css"/>' in out
    tmpl = Template(
        """
        var {{ this.get_name() }} = (function(){
            {{ this.callback }}

            var data = {{ this.data|tojson }};
            var cluster = L.markerClusterGroup({{ this.options|tojson }});
            {%- if this.icon_create_function is not none %}
            cluster.options.iconCreateFunction =
                {{ this.icon_create_function.strip() }};
            {%- endif %}

            for (var i = 0; i < data.length; i++) {
                var row = data[i];
                var marker = callback(row);
                marker.addTo(cluster);
            }

            cluster.addTo({{ this._parent.get_name() }});
            return cluster;
        })();
    """
        )
    expected = normalize(tmpl.render(this=mc))
    assert expected in out

test_fast_marker_cluster()

import numpy as np
from jinja2 import Template
import folium
from folium import plugins
from folium.utilities import normalize
def test_marker_cluster():
    N = 100
    np.random.seed(seed=26082009)
    data = np.array([np.random.uniform(low=35, high=60, size=N), np.random.
        uniform(low=-12, high=30, size=N)]).T
    m = folium.Map([45.0, 3.0], zoom_start=4)
    mc = plugins.MarkerCluster(data).add_to(m)
    tmpl_for_expected = Template(
        """
        var {{this.get_name()}} = L.markerClusterGroup(
            {{ this.options|tojson }}
        );
        {%- if this.icon_create_function is not none %}
            {{ this.get_name() }}.options.iconCreateFunction =
                {{ this.icon_create_function.strip() }};
            {%- endif %}

        {% for marker in this._children.values() %}
            var {{marker.get_name()}} = L.marker(
                {{ marker.location|tojson }},
                {}
            ).addTo({{this.get_name()}});
        {% endfor %}

        {{ this.get_name() }}.addTo({{ this._parent.get_name() }});
    """
        )
    expected = normalize(tmpl_for_expected.render(this=mc))
    out = normalize(m._parent.render())
    assert '<script src="https://cdnjs.cloudflare.com/ajax/libs/leaflet.markercluster/1.1.0/leaflet.markercluster.js"></script>' in out
    assert '<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/leaflet.markercluster/1.1.0/MarkerCluster.css"/>' in out
    assert '<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/leaflet.markercluster/1.1.0/MarkerCluster.Default.css"/>' in out
    assert expected in out
    bounds = m.get_bounds()
    np.testing.assert_allclose(bounds, [[35.147332572663785, -
        11.520684337300109], [59.839718052359274, 29.94931046497927]])

test_marker_cluster()

import folium
from folium.plugins import groupedlayercontrol
from folium.utilities import normalize
def test_grouped_layer_control():
    m = folium.Map([40.0, 70.0], zoom_start=6)
    fg1 = folium.FeatureGroup(name='g1')
    fg2 = folium.FeatureGroup(name='g2')
    fg3 = folium.FeatureGroup(name='g3')
    folium.Marker([40, 74]).add_to(fg1)
    folium.Marker([38, 72]).add_to(fg2)
    folium.Marker([40, 72]).add_to(fg3)
    m.add_child(fg1)
    m.add_child(fg2)
    m.add_child(fg3)
    lc = groupedlayercontrol.GroupedLayerControl(groups={'groups1': [fg1, fg2]}
        )
    lc.add_to(m)
    out = normalize(m._parent.render())
    assert 'https://cdnjs.cloudflare.com/ajax/libs/leaflet-groupedlayercontrol/0.6.1/leaflet.groupedlayercontrol.min.js' in out
    assert normalize(
        f"""
        L.control.groupedLayers(
            null,
            {{
                "groups1" : {{
                    "g1" : {fg1.get_name()},
                    "g2" : {fg2.get_name()},
                }},
            }},
            {{"exclusiveGroups": ["groups1"]}},
         ).addTo({m.get_name()});
         {fg2.get_name()}.remove();
    """
        ) in out

test_grouped_layer_control()

from jinja2 import Template
import folium
from folium import plugins
from folium.utilities import normalize
def test_scroll_zoom_toggler():
    m = folium.Map([45.0, 3.0], zoom_start=4)
    szt = plugins.ScrollZoomToggler()
    m.add_child(szt)
    out = normalize(m._parent.render())
    tmpl = Template(
        """
        <img id="{{this.get_name()}}" alt="scroll"
        src="https://cdnjs.cloudflare.com/ajax/libs/ionicons/2.0.1/png/512/arrow-move.png"
        style="z-index: 999999"
        onclick="{{this._parent.get_name()}}.toggleScroll()"></img>
    """
        )
    assert ''.join(tmpl.render(this=szt).split()) in ''.join(out.split())
    tmpl = Template(
        """
        <style>
            #{{this.get_name()}} {
                position:absolute;
                width:35px;
                bottom:10px;
                height:35px;
                left:10px;
                background-color:#fff;
                text-align:center;
                line-height:35px;
                vertical-align: middle;
                }
        </style>
    """
        )
    expected = normalize(tmpl.render(this=szt))
    assert expected in out
    tmpl = Template(
        """
        {{this._parent.get_name()}}.scrollEnabled = true;

        {{this._parent.get_name()}}.toggleScroll = function() {
            if (this.scrollEnabled) {
                this.scrollEnabled = false;
                this.scrollWheelZoom.disable();
            } else {
                this.scrollEnabled = true;
                this.scrollWheelZoom.enable();
            }
        };

        {{this._parent.get_name()}}.toggleScroll();
    """
        )
    expected = normalize(tmpl.render(this=szt))
    assert expected in out
    bounds = m.get_bounds()
    assert bounds == [[None, None], [None, None]], bounds

test_scroll_zoom_toggler()

